import React from "react";
import styled from "@emotion/styled";
import { css } from "@emotion/react";

const Button = styled.button`
  padding: 32px;
  background-color: hotpink;
  font-size: 24px;
  border-radius: 4px;
  color: black;
  font-weight: bold;
  &:hover {
    color: white;
  }
`;

function App() {
  return (
    <div>
      dd<Button>dd</Button>
      <div
        css={css`
          padding: 32px;
          background-color: hotpink;
          font-size: 24px;
          border-radius: 4px;
          &:hover {
            color: #ffffff;
          }
        `}
      >
        dddd
      </div>
    </div>
  );
}

export default App;
